import * as React from 'react';
import './CourseworkTabs.css';
import Tabs from '../../mui_components/Tabs.js'
import Tab from '../../mui_components/Tab.js'

function CourseworkTabs(props) {
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };
  return (
    <Tabs
        className='Education-coursework-tabs'
        value={value} 
        onChange={handleChange} 
        variant='scrollable' 
        centered
       >
      <Tab label="Comp Sci" />
      <Tab label="Elec/Comp Engr" />
      <Tab label="Finance" />
      <Tab label="Business" />
      <Tab label="IBE" />
      <Tab label="General" />
    </Tabs>
  );
}

export default CourseworkTabs;
